// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

import '@chainlink/contracts/src/v0.8/ChainlinkClient.sol';
import '@chainlink/contracts/src/v0.8/ConfirmedOwner.sol';

abstract contract IOracle is ChainlinkClient {

    using Chainlink for Chainlink.Request;
    uint256 public price;
    bytes32 public jobId;
    uint256 public fee;
    string  public sku;

    function requestPrice() external virtual returns (bytes32);

    event RequestPrice(bytes32 indexed requestId, uint256 price);
}

contracts/Token20.sol.content:
//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";

contract Token20 is ERC20, ERC20Burnable {

    uint8 _decimals;

    constructor(
        string memory tokenName,
        string memory tokenSymbol,
        uint8 decimals_
    ) ERC20(tokenName, tokenSymbol) {
        _decimals = decimals_;
    }

    function mint(address to, uint256 amount) external {
        _mint(to, amount);
    }

    function decimals() public view override returns (uint8) {
        return _decimals;
    }
}

